package gb.backendtestingautomation.practice.dto.response;import com.fasterxml.jackson.annotation.JsonProperty;public class UserListData {    @JsonProperty("page")    private Integer page;    @JsonProperty("per_page")    private Integer perPage;    @JsonProperty("total")    private Integer total;    @JsonProperty("total_pages")    private Integer totalPages;    @JsonProperty("data")     private Data[] data;    @JsonProperty("support")    private Support support;    public UserListData() {}    public UserListData(Integer page, Integer perPage, Integer total, Integer totalPages, Data[] data, Support support) {        super();        this.page = page;        this.perPage = perPage;        this.total = total;        this.totalPages = totalPages;        this.data = data;        this.support = support;    }    @JsonProperty("page")    public Integer getPage() {        return page;    }    @JsonProperty("per_page")    public Integer getPerPage() {        return perPage;    }    @JsonProperty("total")    public Integer getTotal() {        return total;    }    @JsonProperty("total_pages")    public Integer getTotalPages() {        return totalPages;    }    @JsonProperty("data")    public Data[] getData() {        return data;    }    @JsonProperty("support")    public Support getSupport() {        return support;    }    @JsonProperty("page")    public void setPage(Integer page) {        this.page = page;    }    @JsonProperty("per_page")    public void setPerPage(Integer perPage) {        this.perPage = perPage;    }    @JsonProperty("total")    public void setTotal(Integer total) {        this.total = total;    }    @JsonProperty("total_pages")    public void setTotalPages(Integer totalPages) {        this.totalPages = totalPages;    }    @JsonProperty("data")    public void setData(Data[] data) {        this.data = data;    }    @JsonProperty("support")    public void setSupport(Support support) {        this.support = support;    }}